import React from 'react';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import AccountCircle from '@material-ui/icons/AccountCircle';
import Typography from '@material-ui/core/Typography';


export default function Post() {

    return(
        <Paper>
            <Grid container spacing={6}>
                <Grid item xs={2}>
                    <AccountCircle />
                </Grid>
                <Grid item xs={2}>
                    <Typography variant="h6" component="h2" style={{fontWeight: 'bold'}}>Trevor O'Farrell</Typography>
                </Grid>
                <Grid item xs={12}>
                    <Typography variant="h6" component="h2" style={{fontWeight: 'bold', textAlign: 'center'}}>events coming up soon</Typography>
                </Grid>
            </Grid>
        </Paper>
    )
}
